;; gorilla-repl.fileformat = 1

;; **
;;; # Generic
;;; 
;;; This worksheet compiles all generic measures between 3 April 2015 and 3 May 2015 by computing statistics for hourly expansions, distributions over 30 days on the complete dataset and where possible on interesting subsets, namely those that involve the news broadcasters as center themselves or for each agent such as authors, messages and topics as well as contacts with their subtypes.
;; **

;; @@

(ns joyful-firefly
  (:refer-clojure :exclude [find sort])
  (:require [gorilla-plot.core :as plot]
            [gorilla-repl.table :as table]
            [gg4clj.core :as gg4clj]
            [monger.collection :as mc]
            [ceres-analytics.db :refer [db broadcasters]]
            [ceres-analytics.measures :as ms]
            [ceres-analytics.cascade :as cs]
            [clojure.data.priority-map :refer [priority-map]]
            [clj-time.core :as t]
            [clj-time.coerce :as c]
            [clj-time.periodic :as p]
            [incanter.stats :as stats]
            [clj-time.format :as f]
            [monger.core :as mg]
            [monger.joda-time]
            [monger.operators :refer :all]
            [aprint.core :refer [aprint]]
            [monger.query :refer :all]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(def t0 (t/date-time 2015 4 3))
(def day-range (range 0 31))
(def hour-range (range 0 (inc (* 24 30))))
(def news-users (map :_id (take 13 (mc/find-maps @db "users" {:name {$in broadcasters}}))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;joyful-firefly/news-users</span>","value":"#'joyful-firefly/news-users"}
;; <=

;; @@
(defn statistics [coll]
  (let [percentiles [0 0.5 1]
        quantiles (zipmap [:q0 :q50 :q100] (stats/quantile coll :probs percentiles))
        ]
    (merge quantiles
    {:mean (stats/mean coll)
     :sd  (stats/sd coll)})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;joyful-firefly/statistics</span>","value":"#'joyful-firefly/statistics"}
;; <=

;; **
;;; # Size
;; **

;; @@
(defn plot-daily-expansion [coll]
  (let [dat {:day day-range
             :count (ms/daily-expansion coll t0 day-range)}] 
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :day :count]]
         [:geom_line {:stat "identity" :color "steelblue"}]
         [:geom_point {:color "steelblue"}]
         [:xlab "Day"]
         [:ylab "Count"]
         [:theme_bw]
         [:ggtitle (str coll " daily expansion")])]
      {:width 6 :height 6})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;joyful-firefly/plot-daily-expansion</span>","value":"#'joyful-firefly/plot-daily-expansion"}
;; <=

;; **
;;; ## Overall
;; **

;; **
;;; ### Core Elements
;; **

;; @@
(def core-size-statistics (map (fn [e] [e (statistics (ms/hourly-expansion e t0 hour-range))]) ["users" "messages" "tags" ]))
(table/table-view (mapv (fn [[k v]] (vec (conj (vals v) k))) core-size-statistics) :columns ["Label" "Standard Deviation" "Average" "Maximum" "Medium" "Minimum"])
