;; **
;;; ### Monthly Distribution
;; **

;; @@
(let [dat {:day (vec (apply concat (repeat 3 day-range)))
           :count (vec (concat (ms/daily-expansion "users" t0 day-range)
                          (ms/daily-expansion "messages" t0 day-range)
                          (ms/daily-expansion "tags" t0 day-range)))
           :element (vec (concat (repeat 31 "users") (repeat 31 "messages") (repeat 31 "tags")))}] 
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes {:x :day :y :count :group :element :color :element}]]
         [:geom_line]
         [:geom_point]
         [:xlab "Day"]
         [:ylab "Count"]
         [:theme_bw]
         [:ggtitle "core elements daily expansion"])]
      {:width 7 :height 6}))
