;; **
;;; ### Contacts
;;; We calculate the expansion for each label given by the model: Publications, Retweets, Replies, Shares and Assignments.
;; **

;; @@
(def contact-size-statistics (map (fn [e] [e (statistics (ms/hourly-expansion e t0 hour-range))]) ["retweets" "replies" "shares" "unknown" "sources" "tagrefs"]))
(table/table-view (mapv (fn [[k v]] (vec (conj (vals v) k))) contact-size-statistics) :columns ["Label" "Standard Deviation" "Average" "Maximum" "Medium" "Minimum"])
