;; @@
(let [dat {:day (vec (apply concat (repeat 6 day-range)))
           :count (vec (concat (ms/daily-expansion "retweets" t0 day-range)
                          (ms/daily-expansion "replies" t0 day-range)
                          (ms/daily-expansion "shares" t0 day-range)
                          (ms/daily-expansion "unknown" t0 day-range)
                          (ms/daily-expansion "sources" t0 day-range)
                               (ms/daily-expansion "tagrefs" t0 day-range)
                               ))
           :element (vec (concat (repeat 31 "retweets") 
                                 (repeat 31 "replies")
                                 (repeat 31 "shares")
                                 (repeat 31 "unknown")
                                 (repeat 31 "sources")
                                 (repeat 31 "tagrefs")
                                 ))}] 
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes {:x :day :y :count :group :element :color :element}]]
         [:geom_line]
         [:geom_point]
         [:xlab "Day"]
         [:ylab "Count"]
         [:theme_bw]
         [:ggtitle "contacts daily expansion"])]
      {:width 7 :height 6}))
