;; @@
(let [result (->> ms/news-authors
       (map
        (fn [{:keys [_id name]}]
          {name
           (apply merge-with +
                  (map
                   (fn [p]
                     (zipmap
                      ms/contacts
                      (map
                       #(if (= % "sources")
                         (mc/count @db % {:target (:target p)})
                         (mc/count @db % {:source (:target p)}))
                       ms/contacts)))
                   (mc/find-maps @db "pubs" {:source _id
                                             :ts {$gt (t/date-time 2015 4 3)
                                                  $lt (t/date-time 2015 5 3)}})))}) )
       (apply merge))]
  (table/table-view (mapv (fn [[k v]] (vec (conj (vals v) k))) result) :columns ["Source" "Unknown" "Articles" "Topics" "Re-Tweets" "Replies" "Shares"]))
