;; @@
(let [news-counts (->> (mc/find-maps @db "pubs" {:source {$in news-users}
                                                 :ts {$gt (t/date-time 2015 4 3)
                              						   $lt (t/date-time 2015 5 3)}})
                      (map (fn [{:keys [ts]}] (t/hour ts)))
                      frequencies
                      (sort-by first <))
      overall-news-count (mc/count @db "pubs" {:source {$in news-users}
                                                 :ts {$gt (t/date-time 2015 4 3)
                              						   $lt (t/date-time 2015 5 3)}})
      other-counts (->> (mc/find-maps @db "pubs" {:source {$nin news-users}
                                                  :ts {$gt (t/date-time 2015 4 3)
                              						   $lt (t/date-time 2015 5 3)}})
                      (map (fn [{:keys [ts]}] (t/hour ts)))
                      frequencies
                      (sort-by first <))
      overall-other-count (mc/count @db "pubs" {:source {$nin news-users}
                                                  :ts {$gt (t/date-time 2015 4 3)
                              						   $lt (t/date-time 2015 5 3)}})
      dat {:hours (map first (concat news-counts other-counts))
           :counts (concat (map (comp #(* 100 %) #(/ % overall-news-count) second) news-counts)
                           (map (comp #(* 100 %) #(/ % overall-other-count) second) other-counts))
           :type (into (take (count other-counts) (repeat "users")) (take (count news-counts) (repeat "broadcasters")))}]
  (gg4clj/view
    [[:<- :d (gg4clj/data-frame dat)]
     (gg4clj/r+
       [:ggplot :d [:aes :hours :counts {:group :type :color :type}]]
       [:geom_line {:stat "identity"}]
       [:geom_point]
       [:xlab "Hour"]
       [:ylab "Percentage"]
       [:theme_bw]
       [:ggtitle "Time-of-day distribution"])]
    {:width 7
     :height 6})
  )
