(let [news-users-0 (filter #(#{"focusonline" "SPIEGELONLINE" "sternde" "tazgezwitscher"} (:name %)) ms/news-authors)
       counts (apply concat (ms/news-daily-expansion news-users-0 t0 day-range))
       dat {:day (mapv last counts)
           :count (mapv second counts) 
           :element (mapv first counts)}] 
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes {:x :day :y :count :group :element :color :element}]]
         [:geom_line]
         [:geom_point]
         [:xlab "Day"]
         [:ylab "Count"]
         [:theme_bw]
         [:ggtitle "news daily expansion"])]
      {:width 7 :height 6}))
