;;;  # TOTAL DEGREE 
;; **

;; @@

(let [result (map (fn [c] (vec (ms/daily-total-degree c t0 day-range))) ms/contacts)
       dat {:day day-range
           :count (map (fn [d] (reduce + (map #(get % d) result))) day-range)}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes {:x :day :y :count}]]
         [:geom_line {:stat "identity" :color "steelblue"}]
         [:geom_point {:color "steelblue"}]
         [:xlab "Day"]
         [:ylab "Count"]
         [:theme_bw]
         [:ggtitle "Total degree daily expansion"])]
      {:width 6 :height 6}))
